import React from 'react'
import requestCards from '../assets/JsonData/request-card-data.json'
import RequestCard from '../components/request-card/RequestCard'

export const Requests = () => {
   

    return (
        <div>
            <h2 className="page-header">Requests</h2>
            <div className="row">
                <div className="col-6">
                    <div className="row">
                        {
                            requestCards.map((item, index) => (
                                <div className="col-6" key={index}>
                                    <RequestCard
                                        icon={item.icon}
                                        count={item.count}
                                        title={item.title}
                                    />
                                </div>
                            ))
                        }
                    </div>
                </div>
            </div>
        </div>
    )
}
